import { FollowService } from "./follow.service";
import { followColumns } from "./columns.config";
import ShopSelect from '@/views/biz-components/shop-select';
import tableMixin from '@/mixins/table.mixin';
export default {
  mixins: [tableMixin],
  serviceInject: function serviceInject() {
    return {
      followService: FollowService
    };
  },
  rxState: function rxState() {
    return {
      followList: this.followService.followList$,
      page: this.followService.page$,
      loading: this.followService.loading$
    };
  },
  components: {
    ShopSelect: ShopSelect
  },
  data: function data() {
    return {
      id: ''
    };
  },
  computed: {
    followColumns: followColumns
  },
  mounted: function mounted() {
    this.id = this.$searchQuery.id; // this.pagination.total = this.followList.page.total_counts
  },
  methods: {
    range: function range(start, end) {
      var result = [];

      for (var i = start; i < end; i++) {
        result.push(i);
      }

      return result;
    },
    disabledDate: function disabledDate(current) {
      return current && current.format('YYYY-MM-DD') > moment().format('YYYY-MM-DD');
    },
    goMemberDetail: function goMemberDetail(e) {
      console.log('跳转到用户详情', e);
      var member_id = e.member_id;
      this.$router.push({
        name: 'brand-staff-info-basic',
        query: {
          id: e.member_id
        }
      });
    },
    onChooseDate: function onChooseDate(e) {
      this.$router.push({
        query: {
          id: this.id,
          follow_date_first: moment(e[0]).format('YYYY-MM-DD'),
          follow_date_last: moment(e[1]).format('YYYY-MM-DD')
        }
      });
    }
  }
};
